# Check if Python is already at the desired version
    current_version = str(sys.version_info.major) + '.' + str(sys.version_info.minor)
    if current_version == python_version:
        print(f"Python is already at version {python_version}")
    else:
        # Switch to the desired Python version using pyenv
        try:
            subprocess.run(['pyenv', 'global', python_version], check=True)
            print(f"Switched to Python version {python_version}")
        except subprocess.CalledProcessError as e:
            print(f"Failed to switch to Python version {python_version}: {e}")
            return

